<script>
    //METODO AJAX
    $(""#btn-guardar"").on(""click"", function (e) {
        if (!$(""form"").valid()) {
            return;
        }

        e.preventDefault();
        var datos = new FormData($(""#formTatuajes"")[0]);

        $.ajax({
            type: ""POST"",
            data: datos,
            url: ""/Tatuaje/Insert"",
            contentType: false,
            processData: false,
            beforeSend: function () {
                $("".contenedor-loader"").slideToggle();
            },
            success: function (r) {
                $("".contenedor-loader"").slideToggle();
                mostrarMensajeInfo(r);
            },
            error: function () {
                $("".contenedor-loader"").slideToggle();
            }

        });
    });
